  render() {
    const { imageSet, updateIndex } = this.props;
    return (
      <div className="Modal">
        <Container>
          <FlexContainer direction="row">
            <Lightbox
              imageSet={routeProps.location.state}
              updateIndex={this.updateIndex}
            />
          </FlexContainer>
        </Container>
      </div>
    );
  }
}
